# necessary Imports
from docx import Document
from PyPDF2 import PdfReader
from pptx import Presentation
from langchain_community.llms import Cohere
from langchain_community.vectorstores import FAISS
from langchain_google_genai import GoogleGenerativeAI
from langchain_google_genai import ChatGoogleGenerativeAI
from langchain.embeddings import HuggingFaceEmbeddings
from langchain_core.runnables import RunnablePassthrough
from langchain_core.output_parsers import StrOutputParser
from langchain_core.messages import AIMessage, HumanMessage
from langchain_google_genai import GoogleGenerativeAIEmbeddings
from langchain_text_splitters import RecursiveCharacterTextSplitter
from langchain_core.prompts  import PromptTemplate, ChatPromptTemplate, MessagesPlaceholder

"""### Step 3:  Download the Dataset from Kaggle

After installing the modules, import the Kaggle dataset.
"""

pdf_file = open('/kaggle/input/ncert-class-10-history/NCERT-Class-10-History.pdf','rb')

"""### Step 4:  Extracting data from PDF

PDF :- Pdf data is extracted using PyPDF2 and all text is stored in a string.
"""

# extracting pdf data
pdf_text = ""
pdf_reader = PdfReader(pdf_file)
for page in pdf_reader.pages:
    pdf_text += page.extract_text()

"""###**Step 5:  Chunking**

Recursive Character Splitter breaks large documents into smaller chunks. This is useful both for indexing data and for passing it in to a model, since large chunks are harder to search over and won’t fit in a model’s finite context window.
"""

# splitting the text into chunks for embeddings creation

text_split = RecursiveCharacterTextSplitter(
        chunk_size = 1000,
        chunk_overlap = 200, # This is helpul to handle the data loss while chunking.
        length_function = len,
        separators=['\n', '\n\n', ' ', '']
    )

chunks = text_split.split_text(text = pdf_text)

"""###**Step 6:  Embeddings Creation**

Imagine you want to build a system that can answer questions about a bunch of documents. To do this, you need to help the system "understand" the meaning of the words in those documents.

Embeddings are like a secret code that turns words and sentences into numbers. These numbers capture the meaning of the words, so words with similar meanings have similar numbers. This "code" helps the system find connections between the questions and the documents, making it easier to give the right answers.
"""

# Initializing embeddings model
embeddings = HuggingFaceEmbeddings(model_name='sentence-transformers/all-MiniLM-L6-v2')

"""###**Step 7:  Indexing**

Indexing data using Facebook AI Similarity Search (FAISS)
"""

# Indexing the data using FAISS
vectorstore = FAISS.from_texts(chunks, embedding = embeddings)

"""###**Step 8:  Creating The Retriever**

The retriever uses a pre-built index to find information related to your question. It does this by comparing your question to the information in the index and finding the best matches.
"""

# creating retriever
retriever = vectorstore.as_retriever(search_type="similarity", search_kwargs={"k": 6})
retrieved_docs = retriever.invoke("What happened in The rise of Nationalism in Europe")
len(retrieved_docs)
print(retrieved_docs[0].page_content)

"""###**Step 9:  Using Cohere LLM**

"""

prompt_template = """Answer the question as precise as possible using the provided context. If the answer is
                not contained in the context, say "answer not available in context" \n\n
                Context: \n {context}?\n
                Question: \n {question} \n
                Answer:"""

prompt = PromptTemplate.from_template(template=prompt_template)

# function to create a single string of relevant documents given by Faiss.
def format_docs(docs):
    return "\n\n".join(doc.page_content for doc in docs)

"""###**Step 10:  Building the RAG Pipeline**

"""

# RAG Chain

def generate_answer(question):
    cohere_llm = Cohere(model="command", temperature=0.1, cohere_api_key = os.getenv('cohere_api_key'))

    rag_chain = (
        {"context": retriever | format_docs, "question": RunnablePassthrough()}
        | prompt
        | cohere_llm
        | StrOutputParser()
    )

    return rag_chain.invoke(question)

"""###**Step 11:  Test Your Query**"""

answer = generate_answer("What preprocessing techniques are used in the project?")
print(answer)

